org.jenkinsci.plugins.pipeline.modeldefi.value:
withSonarQubeEnv(installationName: 'MySonarToken') {
                        // Check if project exists (optional)
                        def response = sh(script: """
                            curl -s -u ${SONAR_TOKEN}: -X POST 'http://4.212.242.142:9000/projects/create' \
