execution.script:
pipeline {
    agent { label 'testTarget' }

    environment {
        CI = 'false' // Set to 'false' to ignore build warnings in CI.
        SONAR_PROJECT_KEY  = 'my_react_project'
        SONAR_PROJECT_NAME = 'My React Project'
        SONAR_TOKEN        = "4fe8c24abe2f62c4c91c45c0959e37b9ac05db06"
    }

    options {
        buildDiscarder(logRotator(numToKeepStr: '5'))
        timeout(time: 1, unit: 'HOURS') // Prevents the pipeline from hanging indefinitely
    }

    

    stages {
        stage('Verification') {
            steps {
                    sh 'whoami'
                    sh 'pwd'
                }
        }

        stage('Setup SonarQube Project') {
            steps {
                script {
                    // Assuming the token is stored in Jenkins credentials
                    withSonarQubeEnv(installationName: 'MySonarToken') {
                        // Check if project exists (optional)
                        def response = sh(script: """
                            curl -s -u ${SONAR_TOKEN}: -X POST 'http://4.212.242.142:9000/projects/create' \
                            -d 'name=${SONAR_PROJECT_NAME}&project=${SONAR_PROJECT_KEY}'
                            """, returnStdout: true).trim()
                        echo "Response from SonarQube: ${response}"
                    }
                }
            }
        }
        
        stage('Build and SonarQube Analysis') {
            steps {
                dir('frontend') {
                    withSonarQubeEnv(installationName: 'MySonarToken') {
                        sh 'npm install'
                        sh 'npm run build'
                        sh """
                        sonar-scanner \
                        -Dsonar.projectKey=${env.SONAR_PROJECT_KEY} \
                        -Dsonar.sources=. \
                        -Dsonar.host.url=http://4.212.242.142:9000 \
                        -Dsonar.login=${env.SONAR_TOKEN}
                        """
                    }
                }
            }
        }



        stage("Quality Gate") {
            steps {
                // Correct placement and usage of waitForQualityGate
                waitForQualityGate abortPipeline: true
            }
        }

        stage('Docker Build') {
            steps {
                dir('frontend') {
                    sh 'docker build -t bilalfethi/react-springboot-products-react-app:latest .'
                }
            }
        }

        stage('Docker Push') {
            steps {
                withCredentials([usernamePassword(credentialsId: 'dockerhub', passwordVariable: 'bilal13docker', usernameVariable: 'bilalfethi')]) {
                    sh "docker login -u 'bilalfethi' -p 'bilal13docker'"
                    sh 'docker push bilalfethi/react-springboot-products-react-app:latest'
                }
            }
        }
    }

    post {
        
        failure {
            script {
                def sonarProjectURL = "http://4.212.242.142:9000//dashboard?id=com.example%3Ademo"
                echo 'Sending email with analysis results...'
                emailext (
                    to: 'bilal13.fethi@gmail.com',
                    subject: "Build image Failed - ${env.JOB_NAME}",
                    body: """<p>Please review the issues from the build:</p>
                            <p><strong>Job:</strong> ${env.JOB_NAME}</p>
                            <p><strong>Build:</strong> ${env.BUILD_NUMBER}</p>
                            <ul>
                                <li>"Build image Failed - ${env.JOB_NAME}"</li>
                                <li>"Please review the issues at ${sonarProjectURL}"</li>
                            </ul>""",
                )
            }
        }

        success {
            emailext (
                    mimeType: 'text/html',
                    to: 'bilal13.fethi@gmail.com',
                    subject: "SUCCESS: Build #${env.BUILD_NUMBER} - ${env.JOB_NAME}",
                    body: """<p>See attached analysis reports from the build:</p>
                            <p><strong>Job:</strong> ${env.JOB_NAME}</p>
                            <p><strong>Build:</strong> ${env.BUILD_NUMBER}</p>
                            <ul>
                                <li>"Build image SUCCESS - ${env.JOB_NAME}"</li>
                            </ul>""",
                )
        }
    }
}
